const DiaryList = ({ diaryList }) => {
  console.log(diaryList);
  return (
    <div className="DiartList">
      <h2>일기리스트</h2>
      <h4>{diaryList.length}개 있습니다.</h4>
      <div>
        {diaryList.map((it) => (
          <div>
            <div>작성자 : {it.author}</div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default DiaryList;
